import React from "react";

function TaskCard({ task }) {
  return (
    <div
      style={{
        border: "1px solid #ccc",
        padding: "10px",
        margin: "10px 0",
        borderRadius: "5px",
      }}
    >
      {task.name}
    </div>
  );
}

export default TaskCard;
